Not sure if anyone noticed this before, but I always had fun with the waiting messages from porkbun.com<p>Today I had a particularly slow domain purchase, and I think I got to see all of them at once while waiting for the payment to go through<p>They&#x27;re all returned as part of the repeated calls to check the order status (https:&#x2F;&#x2F;porkbun.com&#x2F;api&#x2F;orders&#x2F;checkOrderStatus), the response looks like this:<p>{
   &quot;error&quot;:0,
   &quot;orderStatus&quot;:&quot;0&quot;,
   &quot;processingStatus&quot;:&quot;going out to lunch&quot;,
   &quot;item_count&quot;:&quot;10&quot;,
   &quot;items_processed&quot;:&quot;8&quot;
}<p>Here&#x27;s the whole list:<p>&quot;waiting for book six&quot;<p>&quot;going out to lunch&quot;<p>&quot;sharpening pitchforks&quot;<p>&quot;for great justice&quot;<p>&quot;bringing it on&quot;<p>&quot;herding piglets&quot;<p>&quot;washing the dishes&quot;<p>&quot;getting jiggy with it&quot;<p>&quot;42&quot;<p>&quot;kissing a gift fish&quot;<p>&quot;testing your patience&quot;<p>&quot;slaying the dragon&quot;<p>&quot;drifting&quot;<p>&quot;realigning zone file&quot;<p>&quot;listening to smooth jaz&quot;<p>&quot;shuffling bits&quot;<p>&quot;slobbering uncontrollably&quot;<p>&quot;syncing the blockchain&quot;<p>&quot;putting out liguid ice fire&quot;<p>&quot;0110110001101111011101100110010100100000011110010110111101110101&quot;<p>&quot;eating a sandwich&quot;<p>&quot;digesting unoriented object&quot;<p>&quot;fueling up flux capacitors&quot;<p>&quot;oinking&quot;<p>&quot;passively aggressing&quot;<p>&quot;testing your patience&quot;<p>&quot;sending obscure XML port mapper&quot;<p>&quot;going out to lunch&quot;<p>&quot;realigning zone file&quot;<p>&quot;shuffling bits&quot;<p>&quot;buying handshake names&quot;<p>&quot;calculating nonsense factor&quot;<p>&quot;mining altcoins&quot;<p>&quot;hold on to your buns&quot;
